SET FOREIGN_KEY_CHECKS=0;

CREATE DATABASE `ticket`
    CHARACTER SET 'utf8mb4'
    COLLATE 'utf8mb4_general_ci';

USE `ticket`;

#
# Structure for the `department` table : 
#

CREATE TABLE `department` (
  `Dpt_id` int(11) NOT NULL AUTO_INCREMENT,
  `Dept_code` int(11) DEFAULT NULL,
  `DptName` varchar(50) DEFAULT NULL,
  `DptStatus` varchar(20) DEFAULT 'Active',
  `DocDate` timestamp(6) NOT NULL DEFAULT current_timestamp(6),
  `Create_By` int(11) DEFAULT NULL,
  PRIMARY KEY (`Dpt_id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

#
# Structure for the `request` table : 
#

CREATE TABLE `request` (
  `Req_id` int(11) NOT NULL AUTO_INCREMENT,
  `TicketNum` varchar(20) DEFAULT NULL,
  `Greetings` varchar(200) DEFAULT NULL,
  `ServiceCat` varchar(50) DEFAULT NULL,
  `Urgency` varchar(10) DEFAULT NULL,
  `Branch` varchar(20) DEFAULT NULL,
  `Purpose` varchar(50) DEFAULT NULL,
  `Description` varchar(200) DEFAULT NULL,
  `Document` mediumblob DEFAULT NULL,
  `Userid` int(11) DEFAULT NULL,
  `DocDate` timestamp(6) NOT NULL DEFAULT current_timestamp(6),
  `ReqTime` time DEFAULT NULL,
  `ReqDate` date DEFAULT NULL,
  `ReqStats` int(11) DEFAULT NULL,
  `Pin` int(11) DEFAULT 0,
  `EditTime` time DEFAULT NULL,
  `EditDate` date DEFAULT NULL,
  PRIMARY KEY (`Req_id`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

#
# Structure for the `reviewers` table : 
#

CREATE TABLE `reviewers` (
  `Rev_id` int(11) NOT NULL AUTO_INCREMENT,
  `Fullname` varchar(50) DEFAULT NULL,
  `Position` varchar(50) DEFAULT NULL,
  `RevDate` date DEFAULT NULL,
  `RevTime` time DEFAULT NULL,
  `Request_id` int(11) DEFAULT NULL,
  `DocDate` timestamp(6) NOT NULL DEFAULT current_timestamp(6),
  PRIMARY KEY (`Rev_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

#
# Structure for the `service_logs` table : 
#

CREATE TABLE `service_logs` (
  `Srv_id` int(11) NOT NULL AUTO_INCREMENT,
  `Uid` int(11) DEFAULT NULL,
  `InCharge` varchar(100) DEFAULT NULL,
  `SetDate` date DEFAULT NULL,
  `SetTime` time DEFAULT NULL,
  `Activity` varchar(20) DEFAULT NULL,
  `Remarks` varchar(100) DEFAULT NULL,
  `ReqNum` varchar(50) DEFAULT NULL,
  `DocDate` timestamp(6) NOT NULL DEFAULT current_timestamp(6),
  PRIMARY KEY (`Srv_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

#
# Structure for the `service_request` table : 
#

CREATE TABLE `service_request` (
  `Req_id` int(11) NOT NULL AUTO_INCREMENT,
  `Userid` int(11) DEFAULT NULL,
  `Client` varchar(100) DEFAULT NULL,
  `Client_Position` varchar(100) DEFAULT NULL,
  `Client_Dpmnt` varchar(100) DEFAULT NULL,
  `Branch` varchar(50) DEFAULT NULL,
  `Service_id` int(11) DEFAULT NULL,
  `Dpmnt` varchar(100) DEFAULT NULL,
  `ReqTime` time DEFAULT NULL,
  `ReqDate` date DEFAULT NULL,
  `Description` varchar(200) DEFAULT NULL,
  `ServiceType` varchar(100) DEFAULT NULL,
  `Attachment` longblob DEFAULT NULL,
  `Tkt_Number` varchar(200) DEFAULT NULL,
  `Tckt_Status` int(11) DEFAULT 1,
  `Edt_Time` time DEFAULT NULL,
  `Edt_Date` date DEFAULT NULL,
  `DocDate` timestamp(6) NOT NULL DEFAULT current_timestamp(6) ON UPDATE current_timestamp(6),
  PRIMARY KEY (`Req_id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

#
# Structure for the `services` table : 
#

CREATE TABLE `services` (
  `Srv_id` int(11) NOT NULL AUTO_INCREMENT,
  `Srv_Name` varchar(100) DEFAULT NULL,
  `Srv_Type` varchar(50) DEFAULT NULL,
  `Srv_Status` int(11) DEFAULT NULL,
  `Cutoff_Status` varchar(20) DEFAULT NULL,
  `Opt_Start` time DEFAULT NULL,
  `Opt_End` time DEFAULT NULL,
  `Description` varchar(200) DEFAULT NULL,
  `Usr_Posted` int(11) DEFAULT NULL,
  `Dptmnt` varchar(100) DEFAULT NULL,
  `DocDate` timestamp(6) NOT NULL DEFAULT current_timestamp(6),
  `Edit_Status` int(11) DEFAULT NULL,
  `Attch_Ctrl` int(11) DEFAULT 1,
  PRIMARY KEY (`Srv_id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

#
# Structure for the `user` table : 
#

CREATE TABLE `user` (
  `Uid` int(11) NOT NULL AUTO_INCREMENT,
  `Username` varchar(50) DEFAULT NULL,
  `Password` varchar(100) DEFAULT NULL,
  `Role` int(11) DEFAULT NULL,
  `Theme` varchar(10) DEFAULT NULL,
  `Create_by` int(11) DEFAULT NULL,
  `Dpt_code` int(11) DEFAULT NULL,
  `Fullname` varchar(50) DEFAULT NULL,
  `Position` varchar(50) DEFAULT NULL,
  `Portal_id` varchar(20) DEFAULT NULL,
  `Branch` varchar(20) DEFAULT NULL,
  `Region` varchar(20) DEFAULT NULL,
  `Access` int(11) DEFAULT 1,
  `Department` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`Uid`),
  UNIQUE KEY `Username` (`Username`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

