#
# Definition for the `ADD_REQUEST` procedure : 
#

CREATE PROCEDURE `ADD_REQUEST`(IN pCategory VARCHAR(50), IN pUrgency VARCHAR(10), IN pPurpose VARCHAR(50), IN pDescription VARCHAR(200), IN pDocument MEDIUMBLOB, IN pUser INTEGER, IN pGreetings VARCHAR(200), IN pBranch VARCHAR(20))
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
    DECLARE vPrefix VARCHAR(2);
    DECLARE vYear CHAR(4);
    DECLARE vLastTicket VARCHAR(20);
    DECLARE vNumber INT;
    DECLARE vTicketNumber VARCHAR(20);

    -- Determine prefix based on urgency
    IF pUrgency = 'LOW' THEN
        SET vPrefix = 'GI';
    ELSEIF pUrgency = 'MEDIUM' THEN
        SET vPrefix = 'SR';
    ELSEIF pUrgency = 'HIGH' THEN
        SET vPrefix = 'IA';
    ELSE
        SET vPrefix = 'GI';
    END IF;

    -- Full year
    SET vYear = DATE_FORMAT(SYSDATE(), '%Y');

    -- Fetch latest ticket number with same prefix + year
    SELECT TicketNum
    INTO vLastTicket
    FROM request
    WHERE TicketNum LIKE CONCAT(vPrefix, vYear, '%')
    ORDER BY CAST(SUBSTRING(TicketNum, CHAR_LENGTH(vPrefix) + CHAR_LENGTH(vYear) + 1) AS UNSIGNED) DESC
    LIMIT 1;

    IF vLastTicket IS NOT NULL THEN
       SET vNumber = CAST(SUBSTRING(vLastTicket, CHAR_LENGTH(vPrefix) + CHAR_LENGTH(vYear) + 1) AS UNSIGNED) + 1;
    ELSE
       SET vNumber = 1;
    END IF;

    SET vTicketNumber = CONCAT(vPrefix, vYear, LPAD(vNumber, 6, '0'));


    -- Insert the request
    INSERT INTO request (
        ServiceCat,
        Urgency,
        Purpose,
        Description,
        Document,
        Userid,
        ReqTime,
        ReqDate,
        ReqStats,
        Greetings,
        TicketNum,
        Branch
    )
    VALUES (
        pCategory,
        pUrgency,
        pPurpose,
        pDescription,
        pDocument,
        pUser,
        NOW(),
        SYSDATE(),
        1,
        pGreetings,
        vTicketNumber,
        pBranch
    );

END;

#
# Definition for the `BOOKINGS` procedure : 
#

CREATE PROCEDURE `BOOKINGS`(IN pCurrPage INTEGER, IN pPagesz INTEGER, IN pSearch VARCHAR(100), IN pUser VARCHAR(50))
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
    DECLARE vOffset INT;
    SET vOffset = (pCurrPage - 1) * pPagesz;
    
    SET @row_number = 0;

    SELECT
        @row_number := @row_number + 1 AS RowNum,
        Req_id,
        Userid,
        Client,
        Client_Position,
        Client_Dpmnt,
        Tkt_Number,
        Tckt_Status,
        ServiceType,
        Dpmnt,
        ReqDate,
         CASE
            WHEN TIMESTAMPDIFF(SECOND, DocDate, NOW()) < 60
                THEN 'Just now'
            WHEN TIMESTAMPDIFF(MINUTE, DocDate, NOW()) < 60
                THEN CONCAT(TIMESTAMPDIFF(MINUTE, DocDate, NOW()), ' mins ago')
            WHEN TIMESTAMPDIFF(HOUR, DocDate, NOW()) < 24
                THEN CONCAT(TIMESTAMPDIFF(HOUR, DocDate, NOW()), ' hours ago')
            WHEN TIMESTAMPDIFF(DAY, DocDate, NOW()) = 1
                THEN '1 day ago'
            WHEN TIMESTAMPDIFF(DAY, DocDate, NOW()) < 7
                THEN CONCAT(TIMESTAMPDIFF(DAY, DocDate, NOW()), ' days ago')
            ELSE DATE_FORMAT(DocDate, '%m/%d/%Y')
        END AS DocDateAgo
       
    FROM `service_request`
    WHERE
         Userid = pUser
      AND (
           Tkt_Number LIKE CONCAT('%', pSearch, '%')
        OR ServiceType LIKE CONCAT('%', pSearch, '%')
        OR Dpmnt LIKE CONCAT('%', pSearch, '%')
        OR Tckt_Status LIKE CONCAT('%', pSearch, '%')
      )
    ORDER BY Req_id DESC
    LIMIT vOffset, pPagesz;
END;

