           t2.Position
     FROM request t1
     LEFT JOIN user t2 ON t1.Userid = t2.Uid
     WHERE Req_id = pId;
     
END;

#
# Definition for the `GET_REQUEST` procedure : 
#

CREATE PROCEDURE `GET_REQUEST`(
    IN pUserid INTEGER,
    IN pCurrentPage INTEGER,
    IN pPageSize INTEGER,
    IN pSearch VARCHAR(100)
)
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
    DECLARE vOffset INT;

    -- Compute offset
    SET vOffset = (pCurrentPage - 1) * pPageSize;

    -- Main query with pagination and search
    SELECT
        Req_id,
        ReqNum,
        Subject,
        Priotype,
        Description,
        DateApplied,
        Status,
        OpenStatus
    FROM request
    WHERE Sender = pUserid
      AND (Subject LIKE CONCAT('%', pSearch, '%') OR pSearch = '')
      AND Status  IN ('New Request', 'Cancelled')
    ORDER BY Req_id DESC
    LIMIT vOffset, pPageSize;

    -- Count total rows matching search for frontend pagination
    SELECT COUNT(*) AS TotalRows
    FROM request
    WHERE Sender = pUserid
      AND (Subject LIKE CONCAT('%', pSearch, '%') OR pSearch = '');
END;

#
# Definition for the `GET_SRVINFO` procedure : 
