#
# Definition for the `LOADNEW_REQUEST` procedure : 
#

CREATE PROCEDURE `LOADNEW_REQUEST`(
    IN pCurrPage INTEGER,
    IN pPagesz INTEGER,
    IN pSearch VARCHAR(100),
    IN pCategory VARCHAR(50)
)
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
    DECLARE vOffset INT;
    SET vOffset = (pCurrPage - 1) * pPagesz;

    SELECT
        t1.Req_id,
        t1.TicketNum,
        t1.Urgency AS levl,
        t1.Branch,
        t2.Fullname,
        t1.ReqDate AS Creation,
        t1.ReqTime AS TimeCreation,
        t1.DocDate,

        CASE
            WHEN TIMESTAMPDIFF(SECOND, t1.DocDate, NOW()) < 60
                THEN 'Just now'
            WHEN TIMESTAMPDIFF(MINUTE, t1.DocDate, NOW()) < 60
                THEN CONCAT(TIMESTAMPDIFF(MINUTE, t1.DocDate, NOW()), ' mins ago')
            WHEN TIMESTAMPDIFF(HOUR, t1.DocDate, NOW()) < 24
                THEN CONCAT(TIMESTAMPDIFF(HOUR, t1.DocDate, NOW()), ' hours ago')
            WHEN TIMESTAMPDIFF(DAY, t1.DocDate, NOW()) = 1
                THEN '1 day ago'
            WHEN TIMESTAMPDIFF(DAY, t1.DocDate, NOW()) < 7
                THEN CONCAT(TIMESTAMPDIFF(DAY, t1.DocDate, NOW()), ' days ago')
            ELSE DATE_FORMAT(t1.DocDate, '%m/%d/%Y')
        END AS DocDateAgo
    FROM request t1
    LEFT JOIN user t2 ON t1.Userid = t2.Uid
    WHERE
         t1.ServiceCat = pCategory
         AND t1.ReqStats = 1
    
      AND (
           t1.TicketNum LIKE CONCAT('%', pSearch, '%')
        OR t1.Urgency LIKE CONCAT('%', pSearch, '%')
        OR t1.Branch LIKE CONCAT('%', pSearch, '%')
        OR t2.Fullname LIKE CONCAT('%', pSearch, '%')
      )
    ORDER BY t1.Req_id DESC
    LIMIT vOffset, pPagesz;
END;

#
# Definition for the `LOAD_ACCOUNTS` procedure : 
#

CREATE PROCEDURE `LOAD_ACCOUNTS`(
    IN pCurrPage INT,
    IN pPagesz INT,
    IN pSearch VARCHAR(100)
)
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
    DECLARE vOffset INT;
    SET vOffset = (pCurrPage - 1) * pPagesz;

    SELECT
        Uid,
        Fullname,
        Username,
        Position,
        Branch,
        Region
    FROM user
    WHERE Role IN (3, 2, 0)
      AND (
           Fullname LIKE CONCAT('%', pSearch, '%')
        OR Username LIKE CONCAT('%', pSearch, '%')
        OR Position LIKE CONCAT('%', pSearch, '%')
        OR Branch LIKE CONCAT('%', pSearch, '%')
        OR Region LIKE CONCAT('%', pSearch, '%')
      )
    ORDER BY Fullname
    LIMIT vOffset, pPagesz;
END;

#
# Definition for the `LOAD_EMAILS` procedure : 
#

CREATE PROCEDURE `LOAD_EMAILS`(IN pCurrPage INTEGER, IN pPagesz INTEGER, IN pSearch VARCHAR(100), IN pUser INTEGER(11), IN pCreateDate DATE, IN pLastUpdate DATE, IN pPin INTEGER(11))
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
    DECLARE vOffset INT;
    SET vOffset = (pCurrPage - 1) * pPagesz;

    SELECT
        Req_id,
        ServiceCat,
        Urgency,
        Purpose,
        Greetings,
        EditTime,
        EditDate,
        Pin,
        Description,
        ReqDate,
        DATE_FORMAT(ReqTime, '%h:%i %p') AS FormattedTime,
        ReqStats,
        Pin
    FROM request
    WHERE Userid = pUser
      AND ReqStats <> 2
      AND (
        (pCreateDate = '' OR reqDate >= pCreateDate)
      AND (pLastUpdate = '' OR reqDate <= pLastUpdate)
      AND (pPin = '' OR Pin = pPin)
           )
      AND (
           ServiceCat LIKE CONCAT('%', pSearch, '%')
        OR Urgency LIKE CONCAT('%', pSearch, '%')
        OR Purpose LIKE CONCAT('%', pSearch, '%')
        OR Description LIKE CONCAT('%', pSearch, '%')
      )
    ORDER BY Req_id DESC
    LIMIT vOffset, pPagesz;
END;

