#
# Definition for the `PAGINATION_DEPT_SERVICES` procedure : 
#

CREATE PROCEDURE `PAGINATION_DEPT_SERVICES`(IN pPageSize INTEGER, IN pCurrentPage INTEGER, IN pDepartment VARCHAR(100), IN pSearch VARCHAR(225), IN pDPMNT VARCHAR(100))
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
    /* DECLARATIONS MUST BE FIRST */
    DECLARE pUserid INT;
    DECLARE vOffset INT;

    /* PAGINATION */
    SET vOffset = (pCurrentPage - 1) * pPageSize;

    /* MAIN QUERY */
    SELECT
        t1.Srv_id,
        t1.Srv_Name,
        t1.Srv_Type,
        t1.Srv_Status,
        t1.Cutoff_Status,
        TIME_FORMAT(t1.Opt_Start, '%h:%i %p') AS Opt_Start,
        TIME_FORMAT(t1.Opt_End, '%h:%i %p')   AS Opt_End,
        t1.Description,
        t1.Usr_Posted,
        t1.Dptmnt,
        t1.DocDate,
        t1.Edit_Status,
        t2.Fullname
    FROM services t1
    LEFT JOIN User t2 ON t1.Usr_Posted = t2.Uid
    WHERE (pDepartment = '' OR t1.Dptmnt = pDepartment)
    AND (
        t1.Srv_Name LIKE CONCAT('%', pSearch, '%')
        OR t1.Dptmnt  LIKE CONCAT('%', pSearch, '%')
      )
      AND (t1.Dptmnt <> pDPMNT OR t1.Dptmnt IS NULL)
    ORDER BY t1.DocDate DESC
    LIMIT pPageSize OFFSET vOffset;

    /* TOTAL RECORD COUNT */
    SELECT COUNT(*) AS TotalRecords
    FROM services
    WHERE Dptmnt = pDepartment;

   

END;

#
# Definition for the `POSTED_SERVICES` procedure : 
#

CREATE PROCEDURE `POSTED_SERVICES`(
    IN pPageSize INT,
    IN pCurrentPage INT,
    IN pDepartment VARCHAR(100)
)
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
    DECLARE vOffset INT;

    /* ===============================
       CALCULATE OFFSET
       =============================== */
    SET vOffset = (pCurrentPage - 1) * pPageSize;

    /* ===============================
       MAIN PAGINATED QUERY
       =============================== */
    SELECT
        Srv_id,
        Srv_Name,
        Srv_Type,
        Srv_Status,
        Cutoff_Status,
        TIME_FORMAT(Opt_Start, '%h:%i %p') AS Opt_Start,
        TIME_FORMAT(Opt_End, '%h:%i %p')   AS Opt_End,
        Description,
        Usr_Posted,
        Dptmnt,
        DocDate,
        Edit_Status
    FROM services
    WHERE Dptmnt = pDepartment
    ORDER BY DocDate DESC
    LIMIT pPageSize OFFSET vOffset;

    /* ===============================
       TOTAL ROW COUNT (for pagination)
       =============================== */
    SELECT COUNT(*) AS TotalRecords
    FROM services
    WHERE Dptmnt = pDepartment;

END;

