#
# Definition for the `SAVE_REQUEST` procedure : 
#

CREATE PROCEDURE `SAVE_REQUEST`(IN pUser INTEGER(11), IN pDescription VARCHAR(200), IN pAttachment LONGBLOB, IN pServiceType VARCHAR(100), IN pDepartment VARCHAR(100), IN pSrvid INTEGER(11))
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
    /* ===============================
       DECLARATIONS (MUST BE FIRST)
       =============================== */
    DECLARE pFullname VARCHAR(100);
    DECLARE pPosition VARCHAR(100);
    DECLARE pDepment  VARCHAR(100);
    DECLARE pBranch   VARCHAR(100);
    DECLARE pTktNew   VARCHAR(20);
    DECLARE vLastNo   BIGINT;

    /* ===============================
       GET USER INFO
       =============================== */
    SELECT
        Fullname,
        Position,
        Department,
        Branch
    INTO
        pFullname,
        pPosition,
        pDepment,
        pBranch
    FROM `User`
    WHERE Uid = pUser;

    /* ===============================
       GENERATE TICKET NUMBER
       =============================== */
    SELECT
        MAX(CAST(SUBSTRING(Tkt_Number, 5) AS UNSIGNED))
    INTO vLastNo
    FROM service_request;

    SET vLastNo = IFNULL(vLastNo, 10000000) + 1;
    SET pTktNew = CONCAT('TKT-', vLastNo);

    /* ===============================
       INSERT REQUEST
       =============================== */
    INSERT INTO service_request
    (
        Userid,
        Client,
        Client_Position,
        Client_Dpmnt,
        Branch,
        Dpmnt,
        ReqTime,
        ReqDate,
        Description,
        ServiceType,
        Attachment,
        Tkt_Number,
        Tckt_Status,
        Service_id
    )
    VALUES
    (
        pUser,
        pFullname,
        pPosition,
        pDepment,
        pBranch,
        pDepartment,
        NOW(),
        CURDATE(),
        pDescription,
        pServiceType,
        pAttachment,
        pTktNew,
        1,
        pSrvid
    );

END;

#
# Definition for the `SESSIONUSER` procedure : 
#

CREATE PROCEDURE `SESSIONUSER`(IN pUserid INTEGER(11))
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
     SELECT
     Uid,
     Role,
     Fullname,
     Branch,
     Position,
     Region,
     Department,
     Portal_id
     FROM user
     WHERE uid = pUserid;
END;

#
# Definition for the `UPDATE_POST_SERVICE` procedure : 
#

CREATE PROCEDURE `UPDATE_POST_SERVICE`(IN pID INTEGER(11), IN pService VARCHAR(100), IN pType VARCHAR(50), IN pAva INTEGER(11), IN pStart TIME, IN pEnd TIME, IN pDescription VARCHAR(200))
    NOT DETERMINISTIC
    CONTAINS SQL
    SQL SECURITY DEFINER
    COMMENT ''
BEGIN
     UPDATE services SET
            Srv_Name = pService,
            Srv_Type = pType,
            Srv_Status = pAva,
            Opt_Start = pStart,
            Opt_End = pEnd,
            Description = pDescription,
            Edit_Status = '1'
     WHERE
          Srv_id = pID;
END;

