  (4,'Software Installation','Request',1,NULL,'08:30:00','11:30:00','We accept software installation to your computer via remote or on your workplace. Then please provide the software need to install.',15,'MIS','2026-01-26 14:31:11',NULL,2),
  (5,'Technical Assistance','Assistance',1,NULL,'08:30:00','17:30:00','You may call us in advance for early preparation and assistance we may served. But don''t forget to apply a ticket to execute the actions.',15,'MIS','2026-01-26 14:32:56',NULL,1),
