  (11,'Employee Records & HR Support Service','Assistance',1,NULL,'08:30:00','17:30:00','The service supports requests such as updating personal information, employment verification, issuance of certificates, clarification of company policies, and coordination of internal HR processes. ',19,'Human Resources','2026-01-27 11:40:37',NULL,2),
  (12,'Workplace Compliance & Policy Enforcement Service','Inquiry',1,NULL,'08:30:00','17:30:00','The service handles internal reports related to policy breaches, code of conduct concerns, attendance violations, and workplace behavior issues. It also supports management in conducting fact-finding.',19,'Human Resources','2026-01-27 11:42:35',NULL,2),
